import React from 'react';

const SideBarMenu = (props) => {
    return (

       
        <div className={`w-[300px] bg-gray-300 shadow-md fixed top-0 left-0 bottom-0 z-2 ${props.show? "-translate-x-full":""}`}
            
        >

        </div>

        
    );
};

export default SideBarMenu;
